                writer.WriteString("method", originsResultResponse.Method);

            if (originsResultResponse.OriginPathOption.IsSet)
                writer.WriteString("origin_path", originsResultResponse.OriginPath);

            if (originsResultResponse.ConnectionTimeoutOption.IsSet)
                writer.WriteNumber("connection_timeout", originsResultResponse.ConnectionTimeoutOption.Value!.Value);

            if (originsResultResponse.TimeoutBetweenBytesOption.IsSet)
                writer.WriteNumber("timeout_between_bytes", originsResultResponse.TimeoutBetweenBytesOption.Value!.Value);

            if (originsResultResponse.HmacAuthenticationOption.IsSet)
                writer.WriteBoolean("hmac_authentication", originsResultResponse.HmacAuthenticationOption.Value!.Value);

            if (originsResultResponse.HmacRegionNameOption.IsSet)
                writer.WriteString("hmac_region_name", originsResultResponse.HmacRegionName);

            if (originsResultResponse.HmacAccessKeyOption.IsSet)
                writer.WriteString("hmac_access_key", originsResultResponse.HmacAccessKey);

            if (originsResultResponse.HmacSecretKeyOption.IsSet)
                writer.WriteString("hmac_secret_key", originsResultResponse.HmacSecretKey);

            if (originsResultResponse.BucketOption.IsSet)
                writer.WriteString("bucket", originsResultResponse.Bucket);

            if (originsResultResponse.PrefixOption.IsSet)
                writer.WriteString("prefix", originsResultResponse.Prefix);
        }
    }
